			shellScript = "#!/bin/sh\n\nUNIVERSAL_OUTPUTFOLDER=${BUILD_DIR}/${CONFIGURATION}-universal\nSDK_TARGET=WildcardSDK\n\n# make sure the output directory exists\nmkdir -p \"${UNIVERSAL_OUTPUTFOLDER}\"\n\n# Step 1. Build Device and Simulator versions\nxcodebuild -target \"${SDK_TARGET}\" ONLY_ACTIVE_ARCH=NO -configuration ${CONFIGURATION} -sdk iphoneos  BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\nxcodebuild -target \"${SDK_TARGET}\" -configuration ${CONFIGURATION} -sdk iphonesimulator ONLY_ACTIVE_ARCH=NO BUILD_DIR=\"${BUILD_DIR}\" BUILD_ROOT=\"${BUILD_ROOT}\" clean build\n\n# Step 2. Copy the framework structure (from iphoneos build) to the universal folder\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${SDK_TARGET}.framework\" \"${UNIVERSAL_OUTPUTFOLDER}/\"\n\n# Step 3. Copy Swift modules (from iphonesimulator build) to the copied framework directory\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${SDK_TARGET}.framework/Modules/${SDK_TARGET}.swiftmodule/.\" \"${UNIVERSAL_OUTPUTFOLDER}/${SDK_TARGET}.framework/Modules/${SDK_TARGET}.swiftmodule\"\n\n# Step 4. Create universal binary file using lipo and place the combined executable in the copied framework directory\nlipo -create -output \"${UNIVERSAL_OUTPUTFOLDER}/${SDK_TARGET}.framework/${SDK_TARGET}\" \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${SDK_TARGET}.framework/${SDK_TARGET}\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${SDK_TARGET}.framework/${SDK_TARGET}\"\n\n\n# Step 5. Convenience step to copy the framework to the project's directory\nrm -rf \"${PROJECT_DIR}/${SDK_TARGET}.framework\"\ncp -R \"${UNIVERSAL_OUTPUTFOLDER}/${SDK_TARGET}.framework\" \"${PROJECT_DIR}\"\n\n\n# Step 6. Convenience step to copy the framework to the user's desktop SDK_TARGET. Zip it up\nrm -rf \"${HOME}/Desktop/${SDK_TARGET}.framework\"\nrm -rf \"${HOME}/Desktop/${SDK_TARGET}.framework.tar.gz\"\nrm -rf \"${HOME}/Desktop/${SDK_TARGET}_iphoneos.framework.tar.gz\"\ncp -R \"${UNIVERSAL_OUTPUTFOLDER}/${SDK_TARGET}.framework\" \"${HOME}/Desktop/${SDK_TARGET}.framework\"\n\n# Step 7. Zip up all final frameworks for distribution. Put these up on S3\ncd \"${HOME}/Desktop/\"\n\ntar -cvzf \"${SDK_TARGET}.framework.tar.gz\" \"${SDK_TARGET}.framework\"\n\n# Copy the iphoneos specific product, this is for release (not debugging) since it has only ARM archs\nrm -rf \"${HOME}/Desktop/${SDK_TARGET}.framework\"\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${SDK_TARGET}.framework\" \"${HOME}/Desktop/${SDK_TARGET}.framework\"\n\ntar -cvzf \"${SDK_TARGET}_iphoneos.framework.tar.gz\" \"${SDK_TARGET}.framework\"\n\n# Step 8. Clean up\nrm -rf \"${HOME}/Desktop/${SDK_TARGET}.framework\"\n\n\n";
